import React from 'react';
import FaqStyle from '../styles/faq.style.js';


const Faq = () => {
  return (
    <FaqStyle>
      <div>
        <h1>Faq</h1>
        <ul>Who is this for?
        </ul>
        <p>Anyone who wants to find a buddy to workout with</p>
      </div>
    </FaqStyle>
  );
}

export default Faq;
